    const Checkbox = useRef(null);

    const onClick = (): void => {
        if (Checkbox.current != null) {
            callback(Checkbox.current?.checked)
        }

    }

    return (
        <div onClick={onClick}>
            <input type="checkbox" ref={Checkbox} className={styles.menu_checkbox} id='menu_checkbox' />
            <label htmlFor="menu_checkbox">
                <div></div>
                <div></div>
                <div></div>
            </label>
        </div>
)
})

